      apply_now_hidden
      apply_now_url
      company
      legacy_custom_application_questions_access
      custom_questions
      evicted_bkg_question_enabled
      conviction_bkg_question_enabled
      civil_action_bkg_question_enabled
      has_past_leases
      has_receipts
      has_payment_request_rules
      has_received_payments
      has_archived_applicants
      has_archived_leads
      has_archived_tenants
      has_past_tenants
      has_evaluations
